import LoginForm from "./LoginForm";

function LoginPage() {
    return (
      <div className="LoginPage background">
        <div class="container">
            <div class="row">
                <div class="col-md-4 mx-auto">
                    <LoginForm></LoginForm>
                </div>
            </div>
        </div>
      </div>
    );
  }

  export default LoginPage;
